application.desc=Wandora is a general purpose information extraction, aggregation, management, and publishing application based on Topic Maps and Java. Wandora has graphical user interface, layered presentation of knowledge, several data storage options, huge collection of data extraction, import and export options, embedded server, and open plug-in architecture. Wandora is a FOSS application with GNU GPL license. 
application.homepage=http://wandora.org
application.title=wandora-org
application.vendor=Wandora Team
